// SPDX-License-Identifier: BUSL-1.1
pragma solidity =0.8.4;

import "./Interfaces/Interfaces.sol";
import "./Libraries/ABDKMathQuad.sol";

contract TvlOracle is ITvlOracle {
    using ABDKMathQuad for int128;

    address[] public cTokens;
    uint256 public tvlCumulativeLast;
    uint256 public blockTimestampLast;
    uint256 public totalTvl;
    // mapping from underlying address to a corresponding priceProvider
    mapping(address => address) public priceProviders;

    constructor(
        address[] memory _cTokens,
        address[] memory _assets,
        address[] memory _priceProviders
    ) public {
        // Initializing cTokens
        cTokens = _cTokens;

        // Initializing Price providers
        for (uint256 i = 0; i < _assets.length; i++) {
            priceProviders[_assets[i]] = _priceProviders[i];
        }
    }

    /**
     * @notice Returns the current tvl across all the cTokens
     * @return tvl Current tvl
     */
    function getTotalTvl() public view returns (uint256 tvl) {
        for (uint256 i = 0; i < cTokens.length; i++) {
            ICErc20Delegator cToken = ICErc20Delegator(cTokens[i]);
            address underlyingAsset = cToken.underlying();
            IERC20 underlyingAssetContract = IERC20(underlyingAsset);
            IPriceProvider priceProvider = IPriceProvider(
                priceProviders[underlyingAsset]
            );
            uint256 usdBalance = ((cToken.getCash() *
                priceProvider.latestAnswer()) /
                (10**underlyingAssetContract.decimals()));
            tvl += usdBalance;
        }
    }

    /**
     * @notice Returns latest Cumulative
     * @return currentCumulativeTvl Current cumulative
     * @return blockTimestamp Current block timestamp
     * @return updatedTotalTvl Current TVL
     */
    function getCurrentCumulativeTvl()
        public
        view
        returns (
            uint256 currentCumulativeTvl,
            uint256 blockTimestamp,
            uint256 updatedTotalTvl
        )
    {
        blockTimestamp = uint256(block.timestamp % 2**32);
        uint256 timeElapsed = blockTimestamp - blockTimestampLast; // overflow is desired
        updatedTotalTvl = getTotalTvl();
        uint256 tvlDifference = totalTvl > updatedTotalTvl
            ? (totalTvl - updatedTotalTvl)
            : (updatedTotalTvl - totalTvl);
        uint256 minTvl = totalTvl > updatedTotalTvl
            ? updatedTotalTvl
            : totalTvl;
        if (timeElapsed > 0) {
            currentCumulativeTvl =
                (minTvl +
                    uint256(
                        ABDKMathQuad.toUInt(
                            ABDKMathQuad.div(
                                ABDKMathQuad.fromUInt(tvlDifference),
                                ABDKMathQuad.fromUInt(2)
                            )
                        )
                    )) *
                timeElapsed;
        }
    }

    /**
     * @notice Updates the tvl
     */
    function update() external override {
        (
            uint256 currentCumulativeTvl,
            uint256 blockTimestamp,
            uint256 updatedTotalTvl
        ) = getCurrentCumulativeTvl();

        tvlCumulativeLast += currentCumulativeTvl;
        totalTvl = updatedTotalTvl;
        blockTimestampLast = blockTimestamp;
        emit Sync(totalTvl);
    }
}
